import React, {Component} from 'react';

class CoverTable extends Component{
    render(){
        console.log('COVERS DESDE TABLES: ', this.props.covers);
        return (
            <table class="table table-striped">
                <thead>
                    {this.getHeaders()}
                </thead>
                <tbody>
                    <tr>
                        <th scope="row">1</th>
                        <td>Mark</td>
                        <td>Otto</td>
                        <td>@mdo</td>
                    </tr>
                    <tr>
                        <th scope="row">2</th>
                        <td>Jacob</td>
                        <td>Thornton</td>
                        <td>@fat</td>
                    </tr>
                    <tr>
                        <th scope="row">3</th>
                        <td>Larry</td>
                        <td>the Bird</td>
                        <td>@twitter</td>
                    </tr>
                </tbody>
            </table>
        );
    }

    getHeaders(){
        let tableHeaders = [];
        tableHeaders.push(<th scope="col">#</th>);
        tableHeaders.push(<th scope="col">Cobertura</th>);
        tableHeaders.push(<th scope="col">Informacion</th>)
        tableHeaders.push(<th scope="col">Deducible</th>)
        tableHeaders.push(<th scope="col">Coaseguro</th>)

        return (<tr>{tableHeaders}</tr>)
    }

    getCoverRow(cover, index){
        let columns = [];
        columns.push(<th scope="row">{index + 1}</th>)
        columns.push(<td>{cover.title}</td>);
        columns.push(<td>{cover.content}</td>);
        columns.push(<td>{cover.type === 'deductible'? cover.extraInfo:'-'}</td>)
        columns.push(<td>{cover.type === 'coinsurance'? cover.extraInfo:'-'}</td>)
    }
}

export default CoverTable;
